import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

const TILES_PER_REPO = 4;
const N_COLORS = 5;
const TILES_PER_COLOR = 20;
const N_SHOWN_PENALTIES = 7;

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App 
    playerList={['Hans','Peter']}//TODO: fetch this from inputs on landing page
    playMode="predefined"//TODO: fetch this from inputs on landing page
    tilesPerRepo={TILES_PER_REPO} 
    nColors={N_COLORS} 
    tilesPerColor={TILES_PER_COLOR} 
    nShownPenalties={N_SHOWN_PENALTIES}
    />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
